import React, { useState } from "react";

const LeagueInput = () => {
  const [matches, setMatches] = useState([]);
  const [editIndex, setEditIndex] = useState(-1);

  const handleAddMatch = (e) => {
    e.preventDefault();
    const leagueName = e.target.elements.lesgue.value;
    const newMatch = {
      team1: {
        name: e.target.elements.team1.value,
        score: parseInt(e.target.elements.score1.value),
      },
      team2: {
        name: e.target.elements.team2.value,
        score: parseInt(e.target.elements.score2.value),
      },
    };
    if (editIndex === -1) {
      setMatches([...matches, newMatch]);
    } else {
      setMatches([
        ...matches.slice(0, editIndex),
        newMatch,
        ...matches.slice(editIndex + 1),
      ]);
      setEditIndex(-1);
    }
    e.target.reset();
  };

  const handleDeleteMatch = (index) => {
    setMatches([...matches.slice(0, index), ...matches.slice(index + 1)]);
  };

  const handleEditMatch = (index) => {
    setEditIndex(index);
    const match = matches[index];
    document.getElementsByName("team1")[0].value = match.team1.name;
    document.getElementsByName("score1")[0].value = match.team1.score;
    document.getElementsByName("team2")[0].value = match.team2.name;
    document.getElementsByName("score2")[0].value = match.team2.score;
  };

  return (
    <div className="LeagueInput">
      <form onSubmit={handleAddMatch}>
        <label>
          League Name:
          <input type="text" name="league" />
        </label>
        <label>
          Team 1:
          <input type="text" name="team1" />
        </label>
        <label>
          Score 1:
          <input type="number" name="score1" />
        </label>
        <br />
        <label>
          Team 2:
          <input type="text" name="team2" />
        </label>
        <label>
          Score 2:
          <input type="number" name="score2" />
        </label>
        <br />
        <button type="submit">{editIndex === -1 ? "Add" : "Update"}</button>
        <button type="button" onClick={() => setEditIndex(-1)}>
          Cancel
        </button>
      </form>
      <h2>Matches:</h2>
      <table>
        <thead>
          <tr>
            <th>Team 1</th>
            <th>Score 1</th>
            <th>Team 2</th>
            <th>Score 2</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {matches.map((match, index) => (
            <tr key={index}>
              <td>{match.team1.name}</td>
              <td>{match.team1.score}</td>
              <td>{match.team2.name}</td>
              <td>{match.team2.score}</td>
              <td>
                <button type="button" onClick={() => handleEditMatch(index)}>
                  Edit
                </button>
                <button type="button" onClick={() => handleDeleteMatch(index)}>
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LeagueInput;
